import Header from '../components/Header';

export default class Index extends React.Component{
    render(){
        return(
            <div>
                <Header/>
                <div style={{background: '#D0D0D0', opacity: .3}}>
                    <text>
                        My Portfolio
                    </text>
                </div>
            </div>
        )
    }
}
